/*App.js*/
import React, { Component } from "react";
import Entrance from "./pages/entrance";
import "./App.css";

import { BrowserRouter as Router, Routes, Route }
    from 'react-router-dom';

function App() {

    return (
      <Router>

          <Route exact path="/entrance" component={Entrance} />

      </Router>
    );
}

export default App;
